// src/pages/SuccessPage.js
import React from 'react';
import '../styles/SuccessPage.css'; // Correct path to the CSS file

const SuccessPage = () => {
  return (
    <div className="success-page">
      <h1>Success!</h1>
      <p>Your booking was successful!</p>
      <p>
        This is only a booking. The payment for the services will be negotiated
        directly on-site, and charges will be agreed upon before the service is
        undertaken.
      </p>
    </div>
  );
};

export default SuccessPage;
